import { Link } from "react-router-dom";

function AllBags() {
  return (
    <div className="zipper">
      <Link to="/gymbag">Gym Bag</Link>
      <Link to="/casualbag">Casual Bag</Link>
      <Link to="/daypack">Day Pack</Link>
      <Link to="/fannypack">Fanny Pack</Link>
    </div>
  );
}

export default AllBags;
